【塗装用小物セット】<BR><HR color=#7cfc00><BR>
<img src="http://image.rakuten.co.jp/paint/cabinet/04696483/imgrc0072753119.jpg">
<BR>
<TABLE border="0" cellpadding="3" cellspacing="1" bgcolor="#FFCCCC" width="611">  <TBODY>    <TR>      <TD>      <TABLE border="0" cellspacing="1" width="603" cellpadding="4" bgcolor="#ffffff"><TBODY><TR><TD bgcolor="#999999"></TD></TR><TR><TD bgcolor="#F3566D"><font color="#FFFFFF"><b>床塗装用小物セット</b></font></TD></TR><TR><TD bgcolor="#999999"></TD></TR><TR><TD>コンクリート(モルタル)のガレージや工場など、床を塗装する際に必要な小物だけを集めてセットにしました！<br>
どれもプロが使っている本物ばかり。1から小物を集めるのは大変ですが、これを使えばすぐに塗装が出来ますよ♪<BR></TD></TR><TR><TD bgcolor="#999999"></TD></TR><TR><TD bgcolor="#fee7f3"><IMG src="http://www.rakuten.ne.jp/gold/paint/imgs/shohin_btn.gif" width="13" height="13" border="0" hspace="2">１．ローラーバケットセット1セット</TD></TR><TR><TD bgcolor="#999999"></TD></TR><TR><TD>プラスチック製の黒色外容器に、半透明内容器をセットして使います。付属のネットは刷毛部分についた余分な塗料をしごき落とすためのもの。内容器はそのまま使い捨ててもOKです！<BR></TD></TR><tr><TD bgcolor="#999999"></TD></tr><tr><TD bgcolor="#fee7f3"><IMG src="http://www.rakuten.ne.jp/gold/paint/imgs/shohin_btn.gif" width="13" height="13" border="0" hspace="2">２．ローラーバケット内カバー2枚</TD></tr><tr><TD bgcolor="#999999"></TD></tr><tr><TD>取替え式の内カバーです。下塗り1回、上塗り2回塗装されることを考え、各工程に1枚ずつご使用いただけるように、内カバーを2枚ご用意！<br>
洗うのが面倒な方は使うたびに交換をしてください。<BR></TD></tr><tr><TD bgcolor="#999999"></TD></tr><tr><TD bgcolor="#fee7f3"><IMG src="http://www.rakuten.ne.jp/gold/paint/imgs/shohin_btn.gif" width="13" height="13" border="0" hspace="2">３．ローラーバケットネット　2枚</TD></tr><tr><TD bgcolor="#999999"></TD></tr><tr><TD>ローラーやハケについた余分な塗料を落としたり、しごくのに使用します！<BR></TD></tr><tr><TD bgcolor="#999999"></TD></tr><tr><TD bgcolor="#fee7f3"><IMG src="http://www.rakuten.ne.jp/gold/paint/imgs/shohin_btn.gif" width="13" height="13" border="0" hspace="2">４．溶剤ハケ(仕上げ用2 50mm) 又は 水性ハケ(水性用2 50mm)　3本</TD></tr><tr><TD bgcolor="#999999"></TD></tr><tr><TD>安くてしっかりしているとご好評のこちらのハケ！使用する塗料によって溶剤用、水性用をお選びください！シンナー、水で洗って繰り返しご利用いただくことも可能！もちろん使い捨てでもOKです！<BR></TD></tr>
<tr><TD bgcolor="#999999"></TD></tr><tr><TD bgcolor="#fee7f3"><IMG src="http://www.rakuten.ne.jp/gold/paint/imgs/shohin_btn.gif" width="13" height="13" border="0" hspace="2">５．ローラーハンドル　1本 　</TD></tr><tr><TD bgcolor="#999999"></TD></tr><tr><TD>ミドルローラーにもスモールローラーにも使用可能なハンドルです！「使いやすい！」とご好評をいただいています◎<BR></TD></tr>
<tr><TD bgcolor="#999999"></TD></tr><tr><TD bgcolor="#fee7f3"><IMG src="http://www.rakuten.ne.jp/gold/paint/imgs/shohin_btn.gif" width="13" height="13" border="0" hspace="2">６．ローラー　2セット(4本)　</TD></tr><tr><TD bgcolor="#999999"></TD></tr><tr><TD>短毛で泡の発生が少なく、床塗装をする際に最適なローラーです！<BR></TD></tr>
<tr><TD bgcolor="#999999"></TD></tr><tr><TD bgcolor="#fee7f3"><IMG src="http://www.rakuten.ne.jp/gold/paint/imgs/shohin_btn.gif" width="13" height="13" border="0" hspace="2">７．長柄1.3m　1本　</TD></tr><tr><TD bgcolor="#999999"></TD></tr><tr><TD>床の塗装が立ったままでも楽にできます。床塗装以外にも天井塗装にも役立つ1本！<BR></TD></tr>
<TR><TD bgcolor="#999999"></TD></TR> </TBODY></TABLE>      </TD>    </TR>  </TBODY></TABLE><BR><center>
